description:
El dia 25 y 26 de Julio del 2009, tuvo lugar un evento que marco un hito en Espana y sento presedente en Europa, fue la ocasion en la que los lideres e impulsores en pro de la desclasificacion de la presencia extraterrestre por parte de todos los gobiernos, tanto Europeos, de Estados Unidos como el resto del mundo, se reunieron en una historica cumbre en Barcelona.

   En este DVD podra disfrutar de la magnifica participacion del Sargento Mayor(R) de los Estados Unidos Rober Dean Orel.

